import React from 'react';
import './App.css';
import Navbar from './component/Navbar';
import 'bootstrap/dist/css/bootstrap.css'
import './component/index.css'
import Signup from './component/Signup';
import Login from './component/Login';
import SearchBus from './component/SearchBus'

import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom'
import SeatLayout from './component/SeatLayout';

function App() {
  return (
    <div className="bus-image">
      <Router>
        <Navbar />
        <Switch>
          <Route exact path="/" render={props => <Signup {...props} />} />
          <Route exact path="/login" render={props => <Login {...props} />} />
          <Route exact path="/search/bus" render={props => <SearchBus {...props} />} />
          <Route exact path='/seat/layout' render={props => <SearchBus {...props} />} />
        </Switch>
      </Router>

    </div>
  );
}

export default App;
